import React from 'react';
import ExperienceCard from "./ExperienceCard";
import {
    Container,
    Row,
    Jumbotron
} from "react-bootstrap";


const Experience = ({experiences}) => {
    return (
        <Jumbotron fluid id="art" className="jumbotron jumbotron-fluid m-0">
        <section className="section">
            <Container>
                <Jumbotron fluid className="bg-white">
                    <h2 className="display-4 mb-5 text-center">
                        {experiences.heading}
                    </h2>
                    <img style = {{height:'300px'}} src = {require('./Photos/eagle.jpg')} onClick={this.showModal}/>
                    <img style = {{height:'300px'}} src = {require('./Photos/koala.jpg')}/>
                    <img style = {{height:'300px'}} src = {require('./Photos/stuffedanimal.jpg')}/>
                </Jumbotron>
\            </Container>
        </section>
</Jumbotron>
    );
}
 
export default Experience;
